import React from 'react';
import './rankcard.scss';

const RankCard = () => {
    return (
        <>
            <div className='rank-top'>
                <h4>신입 초봉</h4>
                <h5>
                    <span>30</span> 
                    <span>위</span>
                </h5>
                <p className='rank-percent'>상위 <span>28%</span></p>
                <p className='rank-money'>39,964 <span>천원</span></p>
            </div>
            <div className='rank-bottom'>
                bottom
            </div>
        </>
    );
};

export default RankCard;
